pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "../../core/Publishers.sol";
import "../../core/Assets.sol";

contract ExtendedAssets {

    /**
  *   -validation:   Asset dynamic validation (can be changed from publisher)
  *   -chargeable: transferFrom is allowed with this asset
  *                 This must be set on issue-time and cannot be changed after !!!
  *   -transferLock: * 00 : None (From any wallet to any wallets)
  *                  * 01 : Wallet (From publisher wallets to publishers wallets)
  *                  * 02 : Publisher (Only publisher can transfer into wallets, owner can return to publisher)
  *   -checksum: 64 Char Hash-signature of real-content
 */
    struct Asset {
        bool exists;
        bool chargeable;
        uint8 transferLock;
        bytes32[2] checksum;
        uint32 validation;
    }

    Assets internal _assets;
    Publishers internal _publishers;

    // internal assets
    mapping(bytes32 => Asset) internal assets;


    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    constructor(address publishersAddress, address assetsAddress) public {
        _publishers = Publishers(publishersAddress);
        _assets = Assets(assetsAddress);
    }

    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    /**
    *  Verify sender is owner
    *  additionally require the asset to be active.
    *
    *  active: true when assets needs to be active to proceed
    */
    modifier isOwner(bytes32 id, bool active) {

        // verify asset exists
        require(assets[id].exists == true, "Unknown asset");

        // verify publisher is calling
        bytes8 publisher = Shared.extractPublisher(id);
        require(_publishers.isOwner(publisher, msg.sender), "Only publisher is allowed to modify");

        // check (optional) if asset was disabled
        if (active)
            require(_assets.isActive(id) == true, "Asset disabled modifications not allowed");

        _;
    }

    // -------------------------------------------------------------------------------------------------
    // ------------------------------------ SETTERS ----------------------------------------------------
    // -------------------------------------------------------------------------------------------------

    /**
     * Update validation state
     */
    function setValidation(bytes32 id, uint32 validation) public payable isOwner(id, true) {
        assets[id].validation = validation;
    }

    /**
      * Modify TransferLock Mode
      */
    function setAssetTransferLock(bytes32 id, uint8 transferLock) public payable isOwner(id, true) {
        require(transferLock < 3, "Invalid TransferLock Mode specified");

        assets[id].transferLock = transferLock;
    }

    /**
      * Set hash verification of the "real-life" content.
      * TODO: Implement usage of isValidHash
      */
    function setChecksum(bytes32 id, bytes32[2] memory checksum) public payable isOwner(id, true) {
        //require(isValidHash(id), "Only hash values are allowed");
        assets[id].checksum = checksum;
    }

    struct AssetInfo {
        bool exists;
        bool chargeable;
        uint8 transferLock;
        bytes32[2] checksum;
        uint32 validation;
        bool active;
        bool root;
        uint256 quantity;
        uint256 nfaLimit;
        uint256 nfaQuantity;
        uint256 created;
        address network;
    }

    function getAsset(bytes32 id) public view returns (AssetInfo memory){
        Assets.Asset memory a = _assets.get(id);

        AssetInfo memory asset;
        asset.root = a.root;
        asset.active = a.active;
        asset.quantity = a.quantity;
        asset.nfaLimit = a.nfaLimit;
        asset.nfaQuantity = a.nfaQuantity;
        asset.validation = assets[id].validation;
        asset.created = a.created;
        asset.exists = assets[id].exists;
        asset.chargeable = assets[id].chargeable;
        asset.transferLock = assets[id].transferLock;
        asset.checksum = assets[id].checksum;
        asset.network = a.network;


        return asset;
    }

}
